import React from 'react'
import StudentCourseCard from './StudentCourseCard'
import Studentnavbar from './Studentnavbar'

const StudentCourses = () => {
  let courses=[{name:"Web Development Course",description:"This tsh the Mern Stack course. To create a dropdown menu with the select tag, you firstly need a form element. This is because you will also have a submit button within it (the form element) in order to submit the data to the server."}
  ,{name:"Backend Course with python and Django",description:"To create a dropdown menu with the select tag, you firstly need a form element. This is because you will also have a submit button within it (the form element) in order to submit the data to the server."}]
  return (
    <>
      <Studentnavbar/>    
      <h3 style={{color:"#28a745", textAlign:"center",fontSize:"1.5vw",padding:'0px',marginTop:'2vw',fontWeight:"500"}}>All Courses</h3>
      {courses.map((element) => (<>
           <StudentCourseCard key={element.name} {...element}/>
           </>))}
    </>
  )
}

export default StudentCourses
